;\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1510232","type":"CustomJS"},{"attributes":{},"id":"1510141","type":"SaveTool"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"1510000","type":"BoxAnnotation"},{"attributes":{},"id":"1510139","type":"RedoTool"},{"attributes":{"coordinates":null,"group":null},"id":"1510103","type":"Title"},{"attributes":{"line_alpha":0.2,"line_color":"red","line_width":2,"x":{"field":"x"},"y":{"value":1.0886178947999998}},"id":"1509953","type":"Line"},{"attributes":{},"id":"1509810","type":"UndoTool"},{"attributes":{"coordinates":null,"data_source":{"id":"1509902"},"glyph":{"id":"1509903"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1509905"},"nonselection_glyph":{"id":"1509904"},"view":{"id":"1509907"}},"id":"1509906","type":"GlyphRenderer"},{"attributes":{"coordinates":null,"data_source":{"id":"1509823"},"glyph":{"id":"1510172"},"group":null,"hover_glyph":null,"muted_glyph":{"id
